import React from "react";


import { Grommet, Box, DataTable,Meter, Text } from "grommet";
import { grommet } from "grommet/themes";

import { useQuery } from '@apollo/client';
import { BOOKINFO } from './Query'


const columns = [
    {
      property: 'id',
      header: 'ID',
      primary: true,
    },
    {
      property: 'title',
      header: 'Title',
    },
    {
      property: 'author',
      header: 'Author',
    },
    {
      property: 'Carbs',
      header: 'Carbs',
    }
  ];

  const DATA = [
    {
      name: 'GingerBread',
      Calories: '356',
      Fat: '16',
      Carbs: '49',
      percent: 25,
    },
    {
      name: 'Frozen Yoghurt',
      Calories: '159',
      Fat: '6',
      Carbs: '24',
      percent: 72,
    },
    {
      name: ' Vanilla Ice Cream',
      Calories: '205',
      Fat: '32',
      Carbs: '43',
      percent: 31,
    },
    {
      name: 'Chicken',
      Calories: '150',
      Fat: '10',
      Carbs: '12',
      percent: 95,
    },
    {
      name: 'Soda',
      Calories: '160',
      Fat: '0',
      Carbs: '41',
      percent: 10,
    },
    {
      name: 'Apple Juice',
      Calories: '210',
      Fat: '0',
      Carbs: '28',
      percent: 40,
    },
  ];

  export default function DataTabletest() {
      return (
        <Grommet>
          <Box align='center'>
            <DataTable resizeable='true' sortable='true' size='small' columns={columns} data={DATA} />
          </Box>
        </Grommet>
      );
    }
